schen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lösung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tägliche Arbeit. Mit Begeisterung ergänze ich die Möbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat für Gäste, Kunden und mich selbst immer wieder ein Erlebnis.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1312,1950,2,'Beatrix Otahal','2022-06-01 10:48:00','2022-06-01 10:48:00','45e7ec4e-16bf-4be4-84ff-918b96a8e490',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Räume zu kreieren, in denen sich Gäste wohl fühlen ist meine Spezialität. Die Arbeit mit physischen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lösung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tägliche Arbeit. Mit Begeisterung ergänze ich die Möbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat für Gäste, Kunden und mich selbst immer wieder ein Erlebnis.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NUL