her training in marketing with a master\'s degree in services marketing at the HSLU support me in practical tasks on a day-to-day basis. A wide range of interests and the ability to tackle topics outside of my usual environment also distinguish me. Because my goal is to always keep an eye on the added value for customers and guests.\n\nTranslated with www.DeepL.com/Translator (free version)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1334,1975,1,'René Sigrist','2022-06-02 21:34:22','2022-06-02 21:34:22','86ffb5bf-30c6-44ef-996a-484c67482351',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'René Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfühlungsvermögen. Um die passende Produktlösung für unsere Kunden zu finden, helfen mir neben meiner langjährigen Erfahrung auch die von Vertrauen geprägte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master für Dienstleistungsmarketing an der HSLU unterstützen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zusätzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert für Kunden und Gäste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1335,1976,1,'Beatrix Otahal','2022-06-02 21:35:31','2022-06-02 21:35:31','4bc64628-f6f7-484d-985c-652f7eedf7a3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Bereits in sehr jungen Tagen war klar, Innenarchitektur ist\nmeine Zukunft. Die solide Ausbildung erlaubte den\nEinstieg zum Studium der Architektur und der\nHandelswissenschaften in Österreich.\n\nMeine beruflichen Erfahrungen in den Bereichen\nBauwesen, 3D-CAD, Schreinerarbeiten und FF&E sammelte\nich im Raum Europa und zuletzt schweizweit. Diese über\nJahre erarbeitete Kompetenz für individuelle\nMöblierungen und\nmassgeschneiderte, dekorative\nBeleuchtungen bilden eine wertvolle Ergänzung zu\nHerstellerprodukten.\nDie Gründung LAUTISSIMI Wien 2014 war mein Start zur\nSelbständigkeit mit anschliessender beruflicher\nEtablierung in der Schweiz',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1336,1976,2,'Beatrix Otahal','2022-06-02 21:35:31','2022-06-02 21:35:31','7762dfd8-a8da-4837-99d9-6c3ec0ef8e01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1339,1978,2,'René Sigrist','2022-06-02 21:36:47','2022-06-02 21:36:47','56eddbcb-1924-47f3-83ae-ddcc2a2d3f11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'René Sigrist','Owner, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','I am