2022-09-02 11:48:46','2022-09-02 11:48:46','aba0d150-33aa-48dc-9790-c78f50e6b8c8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Bereits in sehr jungen Jahren war klar, Innenarchitektur ist meine Zukunft. Die solide Ausbildung erlaubte den Einstieg zum Studium der Architektur und der Handelswissenschaften in Österreich. \n\nMeine beruflichen Erfahrungen in den Bereichen Bauwesen, 3D-CAD, Schreinerei und FF&E sammelte ich im Raum Europa und zuletzt schweizweit. Diese über Jahre erarbeitete Kompetenz für individuelle Möblierungen, massgeschneiderte, dekorative Beleuchtungen und umfangreichen Materialisierungen bilden eine wertvolle Ergänzung zu Herstellerprodukten. Die Gründung LAUTISSIMI Wien 2014 war mein Start zur Selbständigkeit mit anschliessender beruflicher Etablierung in der Schweiz.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2220,2675,2,'Beatrix Otahal','2022-09-02 11:48:46','2022-09-02 11:48:46','74bd1241-3284-4b58-a8e2-34b2552a5ad6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2223,2677,1,'René Sigrist','2022-09-02 11:52:37','2022-09-02 11:52:37','63d348b3-ebc2-40c0-b0c0-bca34b52a0b8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'René Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfühlungsvermögen. Um die passende Produktlösung für unsere Kunden zu finden, helfen mir neben meiner langjährigen Erfahrung auch die von Vertrauen geprägte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master für Dienstleistungsmarketing an der HSLU unterstützen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zusätzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert für Kunden und Gäste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2224,2677,2,'René Sigrist','2022-09-02 11:52:37','2022-09-02 11:52:37','7b0bdd32-ade9-4d2a-a15c-5ad5caa8f0b7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'René Sigrist','Owner, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','I´m fascinated of uniqueness by each single project.\nConstantly new initial situations requires flexible thinking\nand a lot of empathy. To find the suitable solution for our\ncustomers I benefit of my vast experience and the\ncooperation with the manufacturers based on trust. The\napprenticed certification to interior decorator and Master\'s\ndegree in Service Marketing at the Lucerne University of\nApplied Sciences and Arts assist me comprehensive all day\nby practical tasks. Additionally a versatile interest and\ntackling topics outside of my usual environment make me\nstand out. Because I keep always a strong eye to the added\nvalue for customers and guests.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2227,2679,2,'Beatrix Otahal','2022-09-02 11:53:41','2022-09-02 11:53:41','150c781f-9f47-4d10-a5e8-002eb01cb237',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences. \nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2228,2679,1,'Beatrix Otahal','2022-09-02 11:53:41','2022-09-02 11:53:41','92953e59-2005-4d2f-86f0-6ceb144dd6ee',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Bereits in sehr jungen Jahren war klar, Innenarchitektur ist meine Zukunft. Die solide Ausbildung erlaubte den Einstieg zum Studium der Architektur und der Handelswissenschaften in Österreich. \n\nMeine beruflichen Erfahrungen in den Bereichen Bauwesen, 3D-CAD, Schreinerei und FF&E sammelte ich im Raum Europa und zuletzt schweizweit. Diese über Jahre erarbeitete Kompetenz für individuelle Möblierungen, massgeschneiderte, dekorative Beleuchtungen und umfangreichen Materialisierungen bilden eine wertvolle Ergänzung zu Herstellerprodukten. Die Gründung LAUTISSIMI Wien 2014 war mein Start zur Selbständigkeit mit anschliessender beruflicher Etablierung in der Schweiz.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2229,2680,1,'Park Hyatt Vienna','2022-09-03 12:22:47','2022-12-26 12:41:57','09a236b2-0023-413e-bfed-7867f2b59568',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'small',NULL,NULL),(2230,2680,2,'Hotel Park Hyatt','2022-09-03 12:22:47','2022-12-26 12:41:57','eef3507d-06a6-494f-a8a8-6c9e96f23e02',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'small',NULL,NULL),(2231,2681,1,'Hotel Park Hyatt','2022-09-03 12:23:21','2022-09-03 12:23:21','4ebc553e-194b-4ded-802c-c3881c6bbef1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2232,2681,2,'Hotel Park Hyatt','2022-09-03 12:23:21','2022-09-03 12:23:21','7bec2799-64b7-4cae-a255-e9b9d6edd46a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2233,2682,1,'Park Hyatt Vienna (Gesamtbeleuchtung)','2022-09-03 12:23:28','2022-12-26 12:46:19','874b3f55-4845-4603-86fa-f055ce82dc05',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gesamtbeleuchtung','Ausarbeitung der Customized Ge