INSERT INTO `matrixcontent_dataprivacycontent` VALUES (156,963,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','32f98ed7-86b6-4028-9809-67c9c8ce9f8d','Einleitung','Wir legen grössten Wert auf den Schutz Ihrer Daten und die Wahrung Ihrer Privatsphäre. Nachstehend informieren wir Sie deshalb über die Erhebung und Verwendung persönlicher Daten bei Nutzung unserer Webseite.\nLAUTISSIMI orientiert sich im Umgang mit Daten am Datenschutzgesetz der Schweiz (DSG) sowie an der EU-Datenschutzgrundverordnung (EU-DSGVO).'),(157,964,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','a4658b5d-223b-4266-a40b-ddbc08d5adc4','Urheberrecht','Die auf dieser Website enthaltenen Inhalte sind für LAUTISSIMI urheberrechtlich geschützt. Insbesondere Vervielfältigungen, Übersetzungen, Bearbeitungen und die Speicherung und Verarbeitung in andere Medien, einschliesslich solcher in elektronischer Form, sind urheberrechtlich geschützt. LAUTISSIMI als Betreiberin der Website gestattet das Sichten und Herunterladen sämtlicher Inhalte auf ihren Websites ausschliesslich zu privatem, nicht-kommerziellem Gebrauch. Die Inhalte dürfen nicht verändert und ohne schriftliche Genehmigung von LAUTISSIMI auf anderen Internetseiten oder vernetzten Rechnern genutzt werden. Die Vervielfältigung von Daten oder Informationen, insbesondere die Verwendung von Texten, Textteilen oder Bildmaterial, bedarf der vorherigen schriftlichen Zustimmung. Für Presseanfragen und die redaktionelle Verwendung von Bildmaterial wenden Sie sich bitte an LAUTISSIMI (siehe Impressum).'),(158,965,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','0132e9ee-149f-4b07-a7dd-326bc5c2552d','Gewährleistung und Haftung','LAUTISSIMI ist darum bemüht, dass die Informationen auf der Website stets auf dem aktuellen Stand sind. Trotz aller Sorgfalt können sich die Daten inzwischen verändert haben. Eine Haftung oder Garantie für die Aktualität, Richtigkeit und Vollständigkeit der zur Verfügung gestellten Informationen kann daher nicht übernommen werden.\nDes Weiteren behält sich die LAUTISSIMI das Recht vor, Änderungen oder Ergänzungen der bereitgestellten Informationen vorzunehmen.'),(159,966,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','422751e7-3430-420a-9a75-a4bac0f50c66','Verweise und Links','Gleiches gilt auch für alle anderen Websites, auf die mittels Hyperlink verwiesen wird. LAUTISSIMI ist für den Inhalt der Websites, die aufgrund einer solchen Verbindung erreicht werden, nicht verantwortlich.'),(160,967,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','0a0452a0-3b2c-45e7-bae8-49a2f0ec9a41','Speicherung von Zugriffsdaten in Server-Logfiles','Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),(161,968,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','baae3061-e684-4c63-a6cd-61c5848865ae','Weitergabe personenbezogener Daten','Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),(162,969,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','32686926-4ec7-4be5-82c0-e061983763c6','Verwendung von Cookies','Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),(163,970,1,'2022-05-24 11:23:54','2022-05-31 11:22:03','ffd022e0-eaf0-4c37-b36c-f74d38bdd048','Kontaktformular','Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten.'),(164,972,1,'2022-05-24 11:23:54','2022-05-24 11:23:54','5d38b1d2-9019-4782-bad4-f2f7014b097d','Einleitung','Wir legen grössten Wert auf den Schutz Ihrer Daten und die Wahrung Ihr