(225,968,2,'2022-05-24 13:17:52','2022-05-31 11:22:03','c60b922d-b6cc-4ed4-8dc3-9b74728ff88a','Disclosure of personal data','Your data will not be passed on to third parties without your express consent. The only exceptions to this are our service partners, which we need to process the contractual relationship, as well as if there is a legal obligation to disclose or the disclosure is necessary for any criminal prosecution and is permitted by law. In these cases, we strictly observe the requirements of the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO). The scope of the data transfer is limited to a minimum.'),(226,969,2,'2022-05-24 13:17:52','2022-05-31 11:22:03','b44a1f2a-04e6-4a9e-9f25-8a105f702bba','Usage of cookies','In order to make visiting our website more attractive and to enable the use of certain functions, we use so-called cookies on various pages. These are small text files that are stored on your terminal device. Some of the cookies we use are deleted at the end of the browser session, i.e. after you close your browser (so-called session cookies). Other cookies remain on your end device and allow us to recognize your browser on your next visit (persistent cookies). You can set your browser so that you are informed about the setting of cookies and decide individually about their acceptance or exclude the acceptance of cookies for certain cases or in general. If you do not accept cookies, the functionality of our website may be limited.'),(227,970,2,'2022-05-24 13:17:52','2022-05-31 11:22:03','45223acb-35d5-419e-9552-289c710ca178','Contact form','If you contact us via the contact form on our website, the data is transmitted in encrypted form to ensure appropriate security of this data.'),(228,1167,1,'2022-05-24 13:17:52','2022-05-24 13:17:52','b8603282-e077-4644-b258-e5f6802a4bcf','Einleitung','Wir legen grössten Wert auf den Schutz Ihrer Daten und die Wahrung Ihrer Privatsphäre. Nachstehend informieren wir Sie d