esting provider. These data are evaluated exclusively to ensure trouble-free operation of the site and to improve our offer and do not allow us to draw any conclusions about your person.\nWe collect personal data if you voluntarily provide it to us when contacting us (e.g. via contact form or e-mail). Which data is collected can be seen from the respective input forms; in doing so, we adhere to the principles of data avoidance and data economy. We use the data you provide to process the contract and to handle your inquiries. After complete processing of the contract or deletion of your customer account, your data will be blocked for further use and deleted, unless you have expressly consented to further use of your data or we reserve the right to use data beyond this, which is permitted by law.'),(349,1819,1,'2022-05-31 11:22:03','2022-05-31 11:22:03','59e5e40e-e49b-4d6e-b608-e384e8f6fa34','Speicherung von Zugriffsdaten in Server-Logfiles','Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),(350,1820,2,'2022-05-31 11:22:03','2022-05-31 11:22:03','c028ea60-6ecf-47a0-9c45-19c9e0c150b6','Disclosure of personal data','Your data will not be passed on to third parties without your express consent. The only exceptions to this are our service partners, which we need to process the contractual relationship, as well as if there is a legal obligation to disclose or the disclosure is necessary for any criminal prosecution and is permitted by law. In these cases, we strictly observe the requirements of the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO). The scope of the data transfer is limited to a minimum.'),(351,1820,1,'2022-05-31 11:22:03','2022-05-31 11:22:03','f8ee0020-2a78-48e5-9a38-78bd84be420d','Weitergabe personenbezogener Daten','Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),(352,1821,2,'2022-05-31 11:22:03','2022-05-31 11:22:03','b95d4abc-d551-44f4-a29d-c98e655ccadf','Usage of cookies','In order to make visiting our website more attractive and to enable the use of certain functions, we use so-called cookies on various pages. These are small text files that are stored on your terminal device. Some of the cookies we use are deleted at the end of the browser session, i.e. after you close your browser (so-called session cookies). Other cookies remain on your end device and allow us to recognize your browser on your next visit (persistent cookies). You can set your browser so that you are informed about the setting of cookies and decide individually about their acceptance or exclude the acceptance of cookies for certain cases or in general. If you do not accept cookies, the functionality of our website may be limited.'),(353,1821,1,'2022-05-31 11:22:03','2022-05-31 11:22:03','4488afdb-6fa1-4fa3-8d05-7e914cf1e963','Verwendung von Cookies','Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),(354,1822,2,'2022-05-31 11:22:03','2022-05-31 11:22:03','23a41fee-6528-4151-b4a4-9424e6565d77','Contact form','If you contact us via the contact form on our website, the data is transmitted in encrypted form to ensure appropriate security of this data.'),(355,1822,1,'2022-05-31 11:22:03','2022-05-31 11:22:03','4815ee3f-c986-46f8-a668-ebef852b7f8c','Kontaktformular','Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten.');
